import './Upload.css';

const Option = ({optionName}) => {
  return (
    <div class = "option">
    <input type="text" id = "option" name = {optionName} />
    <div> {optionName} </div>
    </div>
  );
}



const Upload = () => {
  return (
    <div class= "Upload">
      <div class = "left">
        <div class = "drop_box">
          Upload your Mouse Video
        </div>
        <input type="file" name="uploadedFile" />
      </div>
      <div class ="right">
        <Option optionName = "Mouse Name" />
        <Option optionName = "Experiment Model" />
        <Option optionName = "Heredity" />
        <Option optionName = "Genotype" />
      </div>
    </div>
  );
}

export default Upload;
